@AL_Alookh:لن أندم على أي شخص دخل حياتي ورحل
فالمخلص أسعدني،والسيئ منحني التجربة
والأسوأ كان درسالي،أماالأفضل فلن يتركني أبدا❗المهاتماغاندي

